Text:
I have loved Jack for almost 6 decades. My much younger urologist does too. When I first walked into his waiting room I saw Jack Benny'  well, a whole skeleton w/Jack's hand on cheek and hand on hip. Instantly recognizable.  Which all his other (elderly; VA Hospital) patients didn't notice.

Thanks; 

I started a bunch of you Benny ULs, half have no seed yet.
